<template>
  <view class="history">
    <!-- 历史记录 -->
    <scroll-view style="height: calc(100vh - 130rpx);" scroll-y="true" refresher-enabled :refresher-triggered="refresherTriggered" @refresherpulling="handRefresherpulling" @refresherrefresh="handRefresherrefresh">
      <view class="pressure" style="margin-bottom: 20rpx;" v-for="(item,index) in tabTwo" :key='index'>
        <view class="title" style="margin-bottom: 20rpx;">
          <!-- 	<text style="font-weight: 700;margin-right: 20rpx ">创建时间:</text> -->
          <text :class="item.status==1?'gre':item.status==2?'blu':item.status==3?'bla':'red'">{{item.status==1?'待接单':item.status==2?'已接单':item.status==3?'已完成':item.status==4?'员工取消':'客户取消'}}</text>
        </view>
        <view class="main" @click.stop="detail(item)">

          <view class="main_right">
            <view style="margin-bottom: 10rpx;">
              <text>{{item.name}}</text>
            </view>
            <view style="margin-bottom: 10rpx;">
              <text>{{item.contact_mobile}}</text>
            </view>
            <view class="">
              <text class="text">预约时间:</text>
              <text>{{item.book_date+' '+item.start_time+'-'+item.end_time}}</text>
            </view>
            <view class="arrow">
              <uni-icons type="arrowright" color="#CCCCCC" size="32"></uni-icons>
            </view>
          </view>
        </view>
        <view class="deal">
          <view class="" @click.stop="yes(item)" v-if="item.status==1 || item.status==2" style="margin-right: 0;">
            {{item.status==1?'接单':'完成'}}
          </view>
          <view class="" @click.stop="no(item.id)" v-if="item.status==1">
            拒单
          </view>
          <!-- <view class="" @click.stop="detail(item)" style="margin-right: 0;" >
								详情
							</view> -->
        </view>
      </view>
      <uni-popup ref="popup" type="center">
        <view class="pop clearfix">
          <view class="sus_txt">
            拒单
          </view>
          <view class="con_txt">
            您确定要拒单吗?
          </view>
          <view class="btm">
            <view class="yes" @click.stop="sure">
              确定
            </view>
            <view class="no" @click.stop="close">
              取消
            </view>
          </view>
        </view>
      </uni-popup>
      <uni-popup ref="popup_sus" type="center">
        <view class="pop clearfix">
          <view class="sus_txt">
            {{ite.status==1?'接单':'完成'}}
          </view>
          <view class="con_txt">
            {{ite.status==1?'您确定要接单吗':'订单是否完成?'}}
          </view>
          <view class="btm">
            <view class="yes" @click.stop="sure_sus">
              {{ite.status==1?'确定':'是'}}
            </view>
            <view class="no" @click.stop="close_sus">
              {{ite.status==1?'取消':'否'}}
            </view>
          </view>
        </view>
      </uni-popup>
      <view class="none" v-if="tabTwo.length==0">
        <view class="img">
          <image src="data:image/png;base64," mode=""></image>
        </view>
        <view class="txt">
          暂无待接单订单
        </view>
      </view>
    </scroll-view>
  </view>
</template>
<script>
import uniIcons from "@/components/uni-icons/uni-icons.vue";
import pakTool from "../../../common/utils/utility.js";
import uniPopup from "@/components/uni-popup/uni-popup.vue";
export default {
  components: {
    uniIcons,
    uniPopup,
  },
  props: ["tabTwo"],
  onShow() {},
  watch: {},
  mounted() {},
  data() {
    return {
      historyData: [],
      ur: [],
      maskClickflag: "",
      img_enlarge: "",
      id: "",
      refresherTriggered: false, //自定义下拉刷新
      refresherTriggeredTime: 0, //自定义下拉刷新
      refresherrefreshTime: 0, //自定义下拉刷新回调
      ite: {
        status: "",
      },
    };
  },
  methods: {
    handRefresherpulling(e) {
      clearTimeout(this.refresherTriggeredTime);
      //handRefresherpulling会在用户拉住scroll-view的时候不停的触发，setTimeout延迟执行防止重复修改refresherTriggered，refresherTriggered被修改后也会触发一次handRefresherrefresh
      this.refresherTriggeredTime = setTimeout(() => {
        this.refresherTriggered = true;
      }, 200);
    },
    /**
     * 触发下拉刷新
     * @param {Object} e
     */
    handRefresherrefresh(e) {
      this.$emit("bru", 1);
      clearTimeout(this.refresherrefreshTime);
      //因为官方组件会触发一次handRefresherrefresh，我修改refresherTriggered为true也会触发一次（ -_-|| ）
      this.refresherrefreshTime = setTimeout(() => {
        this.refresherTriggered = false;
      }, 1500);
    },
    detail(item) {
      // console.log()
      uni.navigateTo({
        url: "/pages/manage/watchAppo?item=" + JSON.stringify(item),
      });
    },
    no(id) {
      this.id = id;
      this.$refs.popup.open();
    },
    // 确认拒单
    sure(id) {
      var that = this;
      let requestPak = pakTool.createRequestPak();
      requestPak.requestBody = {
        id: this.id,
        is_who: 2,
      };
      pakTool.request(this, "ums/cancelBooking", requestPak).then((res) => {
        uni.showToast({
          title: "订单取消成功",
          success: function () {
            that.$emit("oneDel", 1);
            that.$refs.popup.close();
          },
        });
      });
    },
    close() {
      this.$refs.popup.close();
    },
    yes(item) {
      this.id = item.id;
      this.ite = item;
      this.$refs.popup_sus.open();
    },
    sure_sus() {
      var num = 3;
      // 如果订单状态为待接单 那么传入接单 否则为成功
      if (this.ite.status == 1) {
        num = 2;
      }
      var that = this;
      let requestPak = pakTool.createRequestPak();
      requestPak.requestBody = {
        id: this.id,
        status: num,
      };
      pakTool.request(this, "ums/dealBooking", requestPak).then((res) => {
        if (num == 2) {
          uni.showToast({
            title: "接单成功",
            success: function () {
              that.$refs.popup_sus.close();
              that.$emit("twoDel", 2);
            },
          });
        } else if (num == 3) {
          uni.showToast({
            title: "操作成功",
            success: function () {
              that.$refs.popup_sus.close();
              that.$emit("fourDel", 4);
            },
          });
        }
      });
    },
    close_sus() {
      this.$refs.popup_sus.close();
    },
  },
};
</script>

